	loadRoot: string,
	// TODO: just use a counter?
	loaders: Record<number, boolean>,
	// TODO: allow Promise<SoundData>?
	sprites: Record<string, SpriteData>,
	sounds: Record<string, SoundData>,
	fonts: Record<string, FontData>,
	shaders: Record<string, ShaderData>,
};

type Assets = {
	loadRoot(path?: string): string,
	loadSprite(
		name: string | null,
		src: SpriteLoadSrc,
		conf?: SpriteLoadConf,
	): Promise<SpriteData>,
	loadSpriteAtlas(
		src: SpriteLoadSrc,
		data: SpriteAtlasData,
	): Promise<Record<string, SpriteData>>,
	loadSpriteAtlas(
		src: SpriteLoadSrc,
		url: string,
	): Promise<Record<string, SpriteData>>,
	loadAseprite(
		name: string | null,
		imgSrc: SpriteLoadSrc,
		jsonSrc: string
	): Promise<SpriteData>,
	loadPedit(name: string | null, src: string): Promise<SpriteData>,
	loadBean(name?: string): Promise<SpriteData>,
	loadSound(
		name: string | null,
		src: string,
	): Promise<SoundData>,
	loadFont(
		name: string | null,
		src: string,
		gw: number,
		gh: number,
		conf?: FontLoadConf,
	): Promise<FontData>,
	loadShader(
		name: string | null,
		vert?: string,
		frag?: string,
		isUrl?: boolean,
	): Promise<ShaderData>,
	loadProgress(): number,
	load<T>(prom: Promise<T>),
	sprites: Record<string, SpriteData>,
	fonts: Record<string, FontData>,
	sounds: Record<string, SoundData>,
	shaders: Record<string, ShaderData>,
};

const ASCII_CHARS = " !\"#$%&'()*+,-./0123456789:;<=>?@ABCDEFGHIJKLMNOPQRSTUVWXYZ[\\]^_`abcdefghijklmnopqrstuvwxyz{|}~";
const CP437_CHARS = "  !\"#$%&'()*+,-./0123456789:;<=>?@ABCDEFGHIJKLMNOPQRSTUVWXYZ[\\]^_`abcdefghijklmnopqrstuvwxyz{|}~";

function loadImg(src: string): Promise<HTMLImageElement> {
	const img = new Image();
	img.src = src;
	img.crossOrigin = "anonymous";
	return new Promise<HTMLImageElement>((resolve, reject) => {
		img.onload = () => {
			resolve(img);
		};
		img.onerror = () => {
			reject(`failed to load ${src}`);
		};
	});
}

function isDataUrl(src: string): boolean {
	return src.startsWith("data:");
}

function assetsInit(gfx: Gfx, audio: Audio, gconf: AssetsConf = {}): Assets {

	const assets: AssetsCtx = {
		lastLoaderID: 0,
		loadRoot: "",
		loaders: {},
		sprites: {},
		sounds: {},
		fonts: {},
		shaders: {},
	};

	function load<T>(prom: Promise<T>): Promise<T> {
		const id = assets.lastLoaderID;
		assets.loaders[id] = false;
		assets.lastLoaderID++;
		return prom
			.catch(gconf.errHandler ?? console.error)
			.finally(() => assets.loaders[id] = true) as Promise<T>;
	}

	// get current load progress
	function loadProgress(): number {

		let total = 0;
		let loaded = 0;

		for (const id in assets.loaders) {
			total += 1;
			if (assets.loaders[id]) {
				loaded += 1;
			}
		}

		return loaded / total;

	}

	// global load path prefix
	function loadRoot(path?: string): string {
		if (path !== undefined) {
			assets.loadRoot = path;
		}
		return assets.loadRoot;
	}

	// TODO: support SpriteLoadSrc
	function loadFont(
		name: string | null,
		src: string,
		gw: number,
		gh: number,
		conf: FontLoadConf = {},
	): Promise<FontData> {
		return load(new Promise<FontData>((resolve, reject) => {
			const path = isDataUrl(src) ? src : assets.loadRoot + src;
			loadImg(path)
				.then((img) => {
					const font = gfx.makeFont(gfx.makeTex(img, conf), gw, gh, conf.chars ?? ASCII_CHARS);
					if (name) {
						assets.fonts[name] = font;
					}
					resolve(font);
				})
				.catch(reject);
		}));
	}

	function getSprite(name: string): SpriteData | null {
		return assets.sprites[name] ?? null;
	}

	function getSound(name: string): SoundData | null {
		return assets.sounds[name] ?? null;
	}

	function getFont(name: string): FontData | null {
		return assets.fonts[name] ?? null;
	}

	function getShader(name: string): ShaderData | null {
		return assets.shaders[name] ?? null;
	}

	function slice(x = 1, y = 1, dx = 0, dy = 0, w = 1, h = 1): Quad[] {
		const frames = [];
		const qw = w / x;
		const qh = h / y;
		for (let j = 0; j < y; j++) {
			for (let i = 0; i < x; i++) {
				frames.push(quad(
					dx + i * qw,
					dy + j * qh,
					qw,
					qh,
				));
			}
		}
		return frames;
	}

	function loadSpriteAtlas(
		src: SpriteLoadSrc,
		data: SpriteAtlasData | string
	): Promise<Record<string, SpriteData>> {
		if (typeof data === "string") {
			// TODO: this adds a new loader asyncly
			return load(fetch(loadRoot() + data)
				.then((res) => res.json())
				.then((data2) => loadSpriteAtlas(src, data2)));
		}
		return load(loadSprite(null, src).then((atlas) => {
			const map = {};
			const w = atlas.tex.width;
			const h = atlas.tex.height;
			for (const name in data) {
				const info = data[name];
				const spr = {
					tex: atlas.tex,
					frames: slice(info.sliceX, info.sliceY, info.x / w, info.y / h, info.width / w, info.height / h),
					anims: info.anims,
				}
				assets.sprites[name] = spr;
				map[name] = spr;
			}
			return map;
		}));
	}

	// load a sprite to asset manager
	function loadSprite(
		name: string | null,
		src: SpriteLoadSrc,
		conf: SpriteLoadConf = {
			sliceX: 1,
			sliceY: 1,
			anims: {},
		},
	): Promise<SpriteData> {

		// synchronously load sprite from local pixel data
		function loadRawSprite(
			name: string | null,
			src: GfxTexData,
			conf: SpriteLoadConf = {
				sliceX: 1,
				sliceY: 1,
				anims: {},
			},
		) {

			const tex = gfx.makeTex(src, conf);
			const frames = slice(conf.sliceX || 1, conf.sliceY || 1);

			const sprite = {
				tex: tex,
				frames: frames,
				anims: conf.anims || {},
			};

			if (name) {
				assets.sprites[name] = sprite;
			}

			return sprite;

		}

		return load(new Promise<SpriteData>((resolve, reject) => {

			if (!src) {
				return reject(`expected sprite src for "${name}"`);
			}

			// from url
			if (typeof(src) === "string") {
				const path = isDataUrl(src) ? src : assets.loadRoot + src;
				loadImg(path)
					.then((img) => resolve(loadRawSprite(name, img, conf)))
					.catch(reject);
			} else {
				resolve(loadRawSprite(name, src, conf));
			}

		}));

	}

	// TODO: accept raw json
	function loadPedit(name: string, src: string): Promise<SpriteData> {

		return load(new Promise<SpriteData>((resolve, reject) => {

			fetch(loadRoot() + src)
				.then((res) => res.json())
				.then(async (data) => {

					const images = await Promise.all(data.frames.map(loadImg));
					const canvas = document.createElement("canvas");
					canvas.width = data.width;
					canvas.height = data.height * data.frames.length;

					const ctx = canvas.getContext("2d");

					images.forEach((img: HTMLImageElement, i) => {
						ctx.drawImage(img, 0, i * data.height);
					});

					return loadSprite(name, canvas, {
						sliceY: data.frames.length,
						anims: data.anims,
					});
				})
				.then(resolve)
				.catch(reject)
				;

		}));

	}

	// TODO: accept raw json
	function loadAseprite(
		name: string | null,
		imgSrc: SpriteLoadSrc,
		jsonSrc: string
	): Promise<SpriteData> {

		return load(new Promise<SpriteData>((resolve, reject) => {

			const jsonPath = loadRoot() + jsonSrc;

			loadSprite(name, imgSrc)
				.then((sprite: SpriteData) => {
					fetch(jsonPath)
						.then((res) => res.json())
						.then((data) => {
							const size = data.meta.size;
							sprite.frames = data.frames.map((f: any) => {
								return quad(
									f.frame.x / size.w,
									f.frame.y / size.h,
									f.frame.w / size.w,
									f.frame.h / size.h,
								);
							});
							for (const anim of data.meta.frameTags) {
								if (anim.from === anim.to) {
									sprite.anims[anim.name] = anim.from
								} else {
									sprite.anims[anim.name] = {
										from: anim.from,
										to: anim.to,
										// TODO: let users define these
										speed: 10,
										loop: true,
									};
								}
							}
							resolve(sprite);
						})
						.catch(reject)
						;
				})
				.catch(reject);

		}));

	}

	function loadShader(
		name: string | null,
		vert?: string,
		frag?: string,
		isUrl: boolean = false,
	): Promise<ShaderData> {

		function loadRawShader(
			name: string | null,
			vert: string | null,
			frag: string | null,
		): ShaderData {
			const shader = gfx.makeProgram(vert, frag);
			if (name) {
				assets.shaders[name] = shader;
			}
			return shader;
		}

		return load(new Promise<ShaderData>((resolve, reject) => {

			if (!vert && !frag) {
				return reject("no shader");
			}

			function resolveUrl(url?: string) {
				return url ?
					fetch(assets.loadRoot + url)
						.then((r) => {
							if (r.ok) {
								return r.text();
							} else {
								throw new Error(`failed to load ${url}`)
							}
						})
						.catch(reject)
					: new Promise((r) => r(null));
			}

			if (isUrl) {
				Promise.all([resolveUrl(vert), resolveUrl(frag)])
					.then(([vcode, fcode]: [string | null, string | null]) => {
						resolve(loadRawShader(name, vcode, fcode));
					})
					.catch(reject);
			} else {
				try {
					resolve(loadRawShader(name, vert, frag));
				} catch (err) {
					reject(err);
				}
			}

		}));

	}

	// TODO: accept dataurl
	// load a sound to asset manager
	function loadSound(
		name: string | null,
		src: string,
	): Promise<SoundData> {

		const url = assets.loadRoot + src;

		return load(new Promise<SoundData>((resolve, reject) => {

			if (!src) {
				return reject(`expected sound src for "${name}"`);
			}

			// from url
			if (typeof(src) === "string") {
				fetch(url)
					.then((res) => {
						if (res.ok) {
							return res.arrayBuffer();
						} else {
							throw new Error(`failed to load ${url}`);
						}
					})
					.then((data) => {
						return new Promise((resolve2, reject2) => {
							audio.ctx.decodeAudioData(data, resolve2, reject2);
						});
					})
					.then((buf: AudioBuffer) => {
						const snd = {
							buf: buf,
						}
						if (name) {
							assets.sounds[name] = snd;
						}
						resolve(snd);
					})
					.catch(reject);
			}

		}));

	}

	function loadBean(name: string = "bean"): Promise<SpriteData> {
		return loadSprite(name, beanSrc);
	}

	loadFont(
		"apl386",
		apl386Src,
		45,
		74,
	);

	loadFont(
		"apl386o",
		apl386oSrc,
		45,
		74,
	);

	loadFont(
		"sink",
		sinkSrc,
		6,
		8,
		{
			chars: ` !"#$%&'()*+,-./0123456789:;<=>?@ABCDEFGHIJKLMNOPQRSTUVWXYZ[\\]^_\`abcdefghijklmnopqrstuvwxyz{|}~`,
		}
	);

	loadFont(
		"sinko",
		sinkoSrc,
		8,
		10,
	);

	return {
		loadRoot,
		loadSprite,
		loadSpriteAtlas,
		loadPedit,
		loadAseprite,
		loadBean,
		loadSound,
		loadFont,
		loadShader,
		loadProgress,
		load,
		sprites: assets.sprites,
		fonts: assets.fonts,
		sounds: assets.sounds,
		shaders: assets.shaders,
	};

}

export {
	AssetsConf,
	Assets,
	assetsInit,
	ASCII_CHARS,
	CP437_CHARS,
};

